function AppViewModel(){var n=this;n.showErrorMessage=ko.observable(!1);n.errorMessage=ko.observable();n.SelectedUserId=ko.observable();n.UserList=ko.observableArray();n.ProjectList=ko.observableArray();n.SelectedUserId.subscribe(function(t){n.showErrorMessage(!1);$.ajax({url:"/api/project/?userid="+t.id(),type:"GET",datatype:"json",success:function(t){var i=$.map(t,function(n){return new ProjectViewModel(n)});n.ProjectList(i)},error:function(t){n.errorMessage(t.statusText);n.showErrorMessage(!0)}})});n.GetUsers=function(){n.showErrorMessage(!1);$.ajax({type:"GET",dataType:"json",url:"/api/user",success:function(t){var i=$.map(t,function(n){return new UserViewModel(n)});n.UserList(i)},error:function(t){n.errorMessage(t.statusText);n.showErrorMessage(!0)}})};n.GetUsers()}function UserViewModel(n){var t=this;t.id=ko.observable(n.id);t.userName=ko.observable(n.firstName+" "+n.lastName)}function ProjectViewModel(n){var t=this;t.projectId=ko.observable(n.projectId);t.credits=ko.observable(n.credits);t.status=ko.observable(n.status);t.startDate=ko.observable(moment(n.startDate).format("MM-DD-YYYY"));t.endDate=ko.observable(moment(n.endDate).format("MM-DD-YYYY"));t.timeToStart=ko.observable(n.timeToStart)}$(document).ready(function(){ko.applyBindings(new AppViewModel)});